import React from 'react'
import { Col, Row, Card } from 'antd';
import './home.css'


const Home = () => {
    const userImg = require("../../assets/images/user.png")
    return (
        <Row className="home">
            <Col span={8}>
                <Card hoverable>
                    <div className="user">
                        <img src={userImg} />
                        <div className='userinfo'></div>
                    </div>
                </Card>
            </Col>
        </Row>
    )
}

export default Home
